import React from "react";
import fairyDreamImage from "../../imgs/fairyTaleDream.webp";
import "./main.css";

function Main() {
  return (
    <section className="container main-excerpt-wrapper">
      <section className="row align-items-center my-5">
        <img src={fairyDreamImage} alt="Dream Clouds" className="main-img" />
        <section className="col-lg-5">
          <h1 className="font-weight-light">Welcome to Smart Dream Journal!</h1>
          <p>
            Where you can log your dreams and have them effortlessly analyzed
            for you
          </p>
        </section>
      </section>
    </section>
  );
}

export default Main;
